import React, { Component } from "react";
import { connect } from "react-redux";
import { Table, Icon } from "react-materialize";
function mapStateToProps(state) {
  return {};
}

class UserTable extends Component {
  displayUser = () => {
    const { users } = this.props;
    users.map(user => {
        console.log(user)
      return (
        <tr key={user._id}>
          <td>{user.name}</td>
          <td>{user.email}</td>
          <td>{user.role}</td>
          <td>{user.active}</td>
          <td>
            <a href="#">
              <Icon>edit</Icon>
            </a>
          </td>
        </tr>
      );
    });
  };
